version: "1"

package:
  id: org.deepin.movie
  name: "deepin-movie"
  version: 5.15.1.1
  kind: app
  description: |
    movie for deepin os.

base: org.deepin.base/23.1.0
runtime: org.deepin.runtime.dtk/23.1.0

command:
  - deepin-movie

build: |
  cat /var/lib/dpkg/status|grep "^Package: " > ${PREFIX}/packages.list
  bash ./install_dep linglong/sources "${PREFIX}"
  cp ${PREFIX}/lib/${TRIPLET}/blas/libblas.* ${PREFIX}/lib/${TRIPLET}
  cp ${PREFIX}/lib/${TRIPLET}/lapack/liblapack.* ${PREFIX}/lib/${TRIPLET}

  # 获取版本号
  VERSION=$(head -1 debian/changelog | awk -F'[()]' '{print $2}')

  cmake -B build ${conf_args} \
        -DSYSTEMD_USER_UNIT_DIR=${PREFIX}/lib/systemd/user \
        -DCMAKE_BUILD_TYPE=Release \
        -DCMAKE_INSTALL_PREFIX=${PREFIX} \
        -DCMAKE_INSTALL_LIBDIR=${PREFIX}/lib/${TRIPLET} \
        -DVERSION=${VERSION}

  cmake --build build -j`nproc`
  cmake --build build --target install

  # 解决GIO运行问题： Settings schema xxx is not installed
  glib-compile-schemas $PREFIX/share/glib-2.0/schemas

